commit_message:
FELIX-5175 - Felix incorrectly destroys sessions - fixed the issue by converting the maxInactive time to milliseconds;
- added a simple test case to show the problem and test the fix.



git-svn-id: https://svn.apache.org/repos/asf/felix/trunk@1727299 13f79535-47bb-0310-9956-ffa450edef68

FELIX-3494 - suppress printing of motd - make some of the arguments of Gosh itself available to the shell;
- add an "quiet" option to suppress printing of the motd.



git-svn-id: https://svn.apache.org/repos/asf/felix/trunk@1725549 13f79535-47bb-0310-9956-ffa450edef68

FELIX-5077 / FELIX-3331 - more reliable shutdown - fix some infrastructure/Maven related issues causing the build to break at
  unexpected moments;
- introduced a base test case that properly created and destroys the parsing
  context (prevents unexpected test failures);
- shut down the shell thread correctly;
- some other minor issues fixed.



git-svn-id: https://svn.apache.org/repos/asf/felix/trunk@1725510 13f79535-47bb-0310-9956-ffa450edef68

Code review: - cleaned up the code to use more recent Java constructs, such as foreach
  loops;
- cleaned up the test cases to make them a bit more readable and easier to
  maintain by folding some duplicate code into helper methods;
- fixed a corner case in which an AutoConf resource drops a configuration while
  updating existing ones at the same time. A NPE could be thrown in this
  situation due ConfigurationAdmin not being present;
- fixed a corner case in which a resource is dropped twice. A IOException could
  be thrown;
- moved some really specific MetaType code to a utility class;
- added some test cases for PersistencyManager;
- applied the code formatting guidelines for Apache Felix.



git-svn-id: https://svn.apache.org/repos/asf/felix/trunk@1724802 13f79535-47bb-0310-9956-ffa450edef68

FELIX-518 - add unit test for signed DPs: - created utility to create signed deployment packages for use in itests;
- verify that signed DPs are correctly installed;
- some small cleanups and typos fixed.



git-svn-id: https://svn.apache.org/repos/asf/felix/trunk@1724647 13f79535-47bb-0310-9956-ffa450edef68

FELIX-518 - support localization and signature files: - ignore signature files (for now);
- allow localization files to precede bundle files.



git-svn-id: https://svn.apache.org/repos/asf/felix/trunk@1716193 13f79535-47bb-0310-9956-ffa450edef68

Minor fixes and updates: - bumped Felix DM and MetaType to latest versions;
- use correct version of Felix parent POM (to solve compilation problems when running Maven from the command line);
- made the AutoConf processor a little more verbose when it stumbles upon wrong resource definitions.



git-svn-id: https://svn.apache.org/repos/asf/felix/trunk@1716104 13f79535-47bb-0310-9956-ffa450edef68

FELIX-4541 - Applied patch from Raluca: - add integration tests for registrations with multiple patterns;
- implement support for registration of patterns using service rankings;
- some dings and dents fixed in the code.



git-svn-id: https://svn.apache.org/repos/asf/felix/trunk@1665462 13f79535-47bb-0310-9956-ffa450edef68

FELIX-4546 - Implement HttpServiceRuntime service: - initial patch from Thomas applied (thanks!);
- fixed a couple of failing itests that were trivial to fix.



